Synopsis: John Douglas (Richard Langin), alias &quot;The Lynx,&quot; has just been released after ten years of imprisonment. He is bent on seeking his revenge on the man responsible for his bad luck, the Public Prosecutor David Bleinstein (Philippe Soine), who now leads a quiet life with his daughter Sarah (Demia Moor) and his new wife Rachel (Julia Spain). Cape Town, South Africa provides the setting for the movie.

